<!DOCTYPE html>
<html>
    <head>
        <meta charset="utf-8">
        <title>jQuery Ajax Retry Prefilter Master</title>
        <link rel="stylesheet" href="qunit-1.10.0.css">
        <link rel="stylesheet" href="qunit-composite.css">
    </head>
    <body>
        <div id="qunit"></div>
        <div id="qunit-fixture"></div>
        <script src="qunit-1.10.0.js"></script>
        <script src="qunit-composite.js"></script>
		
		<!-- Generated by Grunt -->
		<script src="jquery-versions.js"></script>
        
        <script>
            QUnit.done(function(results){
                window.global_test_results = results;
            });
            
            (function( versions ) {
                var i = versions.length;
                
                while( i-- ) {
                    versions[ i ] = "qunit.html?jquery=" + versions[ i ];
                }
                
                QUnit.testSuites( versions );
            }( window.versions ));
        </script>
    </body>
</html>
